import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';
import CollapsibleNavLink from './CollapsibleNavLink';  // Import the new component

const Header: React.FC = () => {
  return (
    <Navbar collapseOnSelect expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand to="/" as={NavLink}>Ionut</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto"></Nav>
          <Nav>
            <CollapsibleNavLink to="/about-me">About Me</CollapsibleNavLink>
            <CollapsibleNavLink to="/skills">Skills</CollapsibleNavLink>
            <CollapsibleNavLink to="/qualification">Qualification</CollapsibleNavLink>
            <CollapsibleNavLink to="/projects">Projects</CollapsibleNavLink>
            <CollapsibleNavLink to="/contact">Contact</CollapsibleNavLink>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
